const r2Test1320: fhir2.NamingSystem = {"contact":[{"name":"FHIR project team","telecom":[{"system":"other","value":"http://hl7.org/fhir"}]}],"date":"2014-12-13","description":"SNOMED CT is a concept-based, scientifically validated terminology that provides a unique and permanent concept identifier that can be included in multiple HL7 data types including CD and CE.  The concepts are managed to avoid \"semantic drift\" so the meaning remains constant.  If the concept is found to be ambiguous or the meaning changes, the concept is inactivated but still retained and the identifier is never reused.    SNOMED CT's concepts are interrelated hierarchically and using description logic.    SNOMED CT concepts have a unique \"fully-specified name\", a preferred term, and, optionally, synonyms.  The description languages include English and Spanish.","id":"example","kind":"codesystem","name":"SNOMED CT","publisher":"HL7 International on behalf of IHTSDO","resourceType":"NamingSystem","responsible":"IHTSDO & affiliates","status":"active","uniqueId":[{"type":"oid","value":"2.16.840.1.113883.6.96"},{"preferred":true,"type":"uri","value":"http://snomed.info/sct"}]};

